import { HStack, Heading, VStack } from "@chakra-ui/react";
import React from "react";

const SideBar = () => {
  return (
    <VStack py="1.4rem">
      <HStack>
        <Heading size="md">Add Friend</Heading>
      </HStack>
    </VStack>
  );
};

export default SideBar;
